description:
The Rental Report time series dataset provides detailed time-series statistics for some key Rental Report data from the March quarter of 2000 to the December quarter of 2017. This specific dataset presents statistics on affordable 3 bedroom rental properties by the 2016 Local Government Areas geographic level.
Affordable rental properties are those within 30 per cent of gross income for low-income households. The rental thresholds are taken from the household incomes for whom that number of bedrooms is a minimum: 


For one-bedroom properties, we have taken the income of singles on Newstart allowance;


For two-bedroom properties, we have taken a single parent pensioner with one child aged under 5;


For three-bedroom properties, we have taken a couple on Newstart with two children;


For four-bedroom properties, we have taken a couple on Newstart with four children.


The Rental Report provides the most accurate information on the private rental market in Victoria. The data come from records kept by the Residential Tenancies Bond Authority (RTBA). The RTBA is responsible for receiving, registering and refunding all bonds associated with private residential leases in Victoria.
For more information please visit the Department of Health and Human Services.

An approved determination of native title is made by way of an order of the court pursuant to ss 86, 87 or 87A of the NTA or s 23 of the Federal Court of Australia Act 1976 (Cth). The determination order details whether or not native title exists, and, if native title does exist:
(a) who holds the native title;
(b) the nature and extent of the native title rights and interests;
(c) the nature and extent of other interests in the determination area; 
(d) the relationship between the different rights and interests in the determiation area; and
(e) the extent to which native title is held to the exclusion of others (s 225 of the NTA).

"Determination outcomes" are extracted from the determination order to broadly categorise the land and waters of the determination area where:
(a) native title does not exist;
(b) native title exists to the exclusion of all others (exclusive);
(c) native title exists but not to the exclusion of all others (non-exclusive); and
(d) native title has been extinguished (extinguished).

Note: Areas depicted in this dataset as “Native title extinguished” are outside of the area subject to the determination. These areas have generally been mentioned in the determination as either:
• having native title extinguished, and/or
• being areas that are excluded from the application, and/or
• not included in the determination area.
